import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import moment from 'moment-timezone';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

moment.tz.setDefault('Europe/Stockholm')
